import React, { Component } from'react'
import axios from 'axios'

class StorageGraft extends Component{
    constructor(props){
        super(props);
        this.state={
            Aggregate:[],
            Svm:[],
        }
    }
    render(){
        return(
            <div className="progress">
                    <div 
                    className="progress-bar progress-bar-striped bg-success"
                    role="progressbar"
                    style={{width:20}}
                    >
                    {20}%
                    </div>
            </div>
            );
    }

}
export default StorageGraft
